import React from "react";
import Navbar from "./Navbar/Navbar";
import { BrowserRouter, Route ,Routes} from "react-router-dom";

export default function App() {
  return (
    <>
      <BrowserRouter>
      <Navbar />
       <Routes>
        <Route path="/" element={<Navbar />} />
        </Routes>
      </BrowserRouter>
    </>
  );
}
